        public List<string> GetImageLinksByHashTag(string hashTag)
        {
            hashTag = hashTag.Replace("#", string.Empty);
            List<string> images = new List<string>();

            try
            {
                using (WebClient webClient = new WebClient())
                {
                    //string targetUrl = $"https://api.instagram.com/v1/tags/{hashTag}/media/recent?access_token={access_token}";
                    string targetUrl = $"https://api.instagram.com/v1/tags/{hashTag}/media/recent?client_id={client_id}";

                    string imagePattern = "\"standard_resolution\":{\"url\":\"(.*?)\",\"width\"";
                    string nextUrlPattern = "\"next_url\":\"(.*?)\"},\"meta\"";

                    string total_body_content = string.Empty;

                    string response = webClient.DownloadString(targetUrl);

                    while (Regex.IsMatch(response, nextUrlPattern))
                    {
                        total_body_content += response;
                        string nextUrl = Regex.Unescape(Regex.Match(response, nextUrlPattern).Groups[1].Value);
                        response = webClient.DownloadString(nextUrl);
                    }
                    total_body_content += response;

                    MatchCollection result = Regex.Matches(total_body_content, imagePattern);
                    images = result.Cast<Match>().Select(match => Regex.Unescape(match.Groups[1].Value)).ToList();
                    images.RemoveAll(img => img.Contains(".mp4"));
                    InstagramSearchLogger.Info($"Instagram have {images.Count} images with {hashTag} on first page of response");
                }
            }
            catch (Exception ex)
            {
                InstagramSearchLogger.Error(ex);
            }

            return images;
        }

