        public bool DownloadImage(string imageUrl, out string imagePath)
        {
            bool result = false;
            string imstagramImagesPath = Path.Combine(InstagramDirName, Settings.CurrentEvent.Id.ToString());
            if (!Directory.Exists(imstagramImagesPath))
            {
                Directory.CreateDirectory(imstagramImagesPath);
            }

            try
            {
                string imageName = Path.GetFileName(imageUrl);
                imagePath = Path.Combine(imstagramImagesPath, imageName);
                using (WebClient wc = new WebClient())
                {
                    wc.DownloadFile(new Uri(imageUrl), imagePath);
                }
                InstagramSearchLogger.Info($"File saved: {imagePath}");
                //FilesHelper.Instance.InstagramAddProcessedFile(imageName);
                if (File.Exists(imagePath))
                {
                    result = true;
                }
            }
            catch (Exception ex)
            {
                InstagramSearchLogger.Error(ex);
                throw;
            }
            return result;
        }

        public List<string> GetInstagramLocalFiles()
        {
            string imstagramImagesPath = Path.Combine(InstagramDirName, Settings.CurrentEvent.Id.ToString());
            if (!Directory.Exists(imstagramImagesPath))
            {
                Directory.CreateDirectory(imstagramImagesPath);
            }
            List<string> files = Directory.GetFiles(imstagramImagesPath, "*.jpg").ToList();

            InstagramSearchLogger.Info($"In folder {imstagramImagesPath} {files.Count} files");

            return files;
        }

        public void PrepareImages(List<string> instagrammNotProcessedImages)
        {
            foreach (var imageUrl in instagrammNotProcessedImages)
            {
                try
                {
                    string imageLocalPath;
                    bool isfileDownloaded = DownloadImage(imageUrl, out imageLocalPath);

                    InstagramSearchLogger.Info($"Locked 1: {FilesHelper.Instance.IsFileLocked(new FileInfo(imageLocalPath))}");

                    if (isfileDownloaded)
                    {
                        InstagramSearchLogger.Info($"Locked 2: {FilesHelper.Instance.IsFileLocked(new FileInfo(imageLocalPath))}");
                        bool isfileResized = FilesHelper.Instance.ResizeImage(imageLocalPath);
                        InstagramSearchLogger.Info($"Locked 3: {FilesHelper.Instance.IsFileLocked(new FileInfo(imageLocalPath))}");
                        bool isfileBordered = ImageHelper.Instance.AddBorderToImage(imageLocalPath);
                        InstagramSearchLogger.Info($"Locked 4: {FilesHelper.Instance.IsFileLocked(new FileInfo(imageLocalPath))}");

                        InstagramSearchLogger.Info($"isfileResized: {isfileResized}");
                        InstagramSearchLogger.Info($"isfileBordered: {isfileBordered}");

                        if (!isfileResized || !isfileBordered)
                        //if (!isfileBordered)
                        {
                            InstagramSearchLogger.Info($"something bad, delete file");
                            FilesHelper.Instance.DeleteFile(imageLocalPath, InstagramSearchLogger);
                        }
                        else
                        {
                            string fileName = Path.GetFileName(imageLocalPath);
                            FilesHelper.Instance.InstagramAddProcessedFile(fileName);
                            InstagramSearchLogger.Info($"File {fileName} marked as processed");
                        }
                    }
                }
                catch (Exception exception)
                {
                    InstagramSearchLogger.Error(exception);
                }
                Thread.Sleep(TimeSpan.FromSeconds(1));

            }
        }
